BEGIN TRANSACTION;
CREATE TABLE `DbInfos` (`name` VARCHAR(50) PRIMARY KEY, `value` VARCHAR(255) NOT NULL, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `Parsers` (`name` VARCHAR(100) NOT NULL UNIQUE, `label` VARCHAR(100) NOT NULL UNIQUE, `description` VARCHAR(255), `isBundled` TINYINT(1) NOT NULL, `id` INTEGER PRIMARY KEY AUTOINCREMENT, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL);
CREATE TABLE `UrlData` (`data` TEXT NOT NULL, `id` INTEGER PRIMARY KEY AUTOINCREMENT, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL, `UrlItemId` INTEGER);
CREATE TABLE `UrlItems` (`id` VARCHAR(50) PRIMARY KEY, `label` VARCHAR(250) NOT NULL, `data` TEXT NOT NULL, `attributs` TEXT, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL, `UrlId` INTEGER);
CREATE TABLE `UrlParameters` (`name` VARCHAR(50) NOT NULL, `value` VARCHAR(250) NOT NULL, `id` INTEGER PRIMARY KEY AUTOINCREMENT, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL, `UrlId` INTEGER);
CREATE TABLE `Urls` (`label` VARCHAR(100) NOT NULL, `url` VARCHAR(2048) NOT NULL, `enable` TINYINT(1) NOT NULL DEFAULT 1, `lastExec` DATETIME, `id` INTEGER PRIMARY KEY AUTOINCREMENT, `createdAt` DATETIME NOT NULL, `updatedAt` DATETIME NOT NULL, `ParserId` INTEGER);
CREATE TABLE sqlite_sequence(name,seq);
COMMIT;
